import React, {useEffect, useState} from "react";
import Node from './Node';

export default function () {
    const [grid, setGrid] = useState([]);

    useEffect(() => {
        initGrid(10, 10);
    }, [])

    const initGrid = (row, col) => {
        const tempGrid = []

        for(var i = 0; i < row; i ++) {
            const currRow = [];
            for(var j = 0; j < col; j++) {
                currRow.push(j);
            }

            tempGrid.push(currRow);
        }

        console.log(tempGrid);
        setGrid(tempGrid);
    }


    return (
        <div className="grid">
            {grid.map((row, rowId) => {
                <div key={rowId}>
                    <Node />
                </div>
            })}
        </div>
    )
}
